import React from "react";
import { Route, Routes } from "react-router-dom";
import RoutePath from "../router/RoutePath";

const Home = () => {
  return (
    <div>
      <Routes>
        <Route to="/" element={<RoutePath />}></Route>
      </Routes>
      <ul>
        <Link to="/home">Home</Link>
      </ul>
    </div>
  );
};

export default Home;
